func getGameData(userId string) (*GameData, error) {
	sess, err := session.NewSession()
	if err != nil {
		return nil, err
	}
	db := dynamodb.New(sess)

	// 検索条件を用意
	getParam := &dynamodb.GetItemInput{
		TableName: aws.String("wordle_game_data"),
		Key: map[string]*dynamodb.AttributeValue{
			"user_id": {
				S: aws.String(userId),
			},
		},
	}

	// 検索
	result, err := db.GetItem(getParam)
	if err != nil {
		return nil, err
	}

	gameData := GameData{}
	err = dynamodbattribute.UnmarshalMap(result.Item, &gameData)
	if err != nil {
		return nil, err
	}

	return &gameData, nil
}

func replyTextMessage(token string, text string) {
	bot, err := linebot.New(
		os.Getenv("CHANNEL_SECRET"),
		os.Getenv("CHANNEL_TOKEN"),
	)
	if err != nil {
		log.Fatal(err)
	}

	if _, err := bot.ReplyMessage(token, linebot.NewTextMessage(text)).Do(); err != nil {
		fmt.Fprintln(os.Stderr, err)
	}
}

