func checkText(text string, event *linebot.Event) error {
	gameData, err := getGameData(event.Source.UserID)
	if err != nil {
		return err
	}
	if gameData.Id == "" {
		return errors.New("data is not in db")
	}

	if gameData.Word == "" {
		replyTextMessage(event.ReplyToken, "send \"new\" to start game")
		return nil
	}

	result := collateTextWithWord(text, gameData.Word)
	// 正解の場合
	if reflect.DeepEqual(result, []int{0, 0, 0, 0, 0}) {
		replyTextMessage(event.ReplyToken, "correct!")
		resetGameData(event.Source.UserID)
		return nil
	}

	// 回数オーバー
	if gameData.Num >= 5 {
		replyTextMessage(event.ReplyToken, fmt.Sprintf("Exceeding the limit!\nAnswer is \"%s\"", gameData.Word))
		err := resetGameData(event.Source.UserID)
		return err
	}

	replyText := ""
	for _, c := range result {
		if c == 0 {
			replyText += "🟩"
		} else if c == 1 {
			replyText += "🟨"
		} else {
			replyText += "⬛"
		}
	}

	replyTextMessage(event.ReplyToken, replyText)
	// add num 1
	err = putGameData(event.Source.UserID, gameData.Word, gameData.Num+1)

	return err
}

func collateTextWithWord(input string, answer string) []int {
	res := []int{2, 2, 2, 2, 2}
	if input == answer {
		res = []int{0, 0, 0, 0, 0}
		return res
	}

	for i, ci := range input {
		for j, ca := range answer {
			if i == j && ci == ca {
				res[i] = 0
			} else if ci == ca {
				res[i] = 1
			}
		}
	}

	return res
}

func resetGameData(userId string) error {
	return putGameData(userId, "", 0)
}

func informCorrectInput(text string, event *linebot.Event) error {
	replyTextMessage(event.ReplyToken, fmt.Sprintf("\"%s\" is not in list!", text))
	return nil
}
